node.text:
Durante o período de pandemia precisamos redobrar os cuidados com a higiene. 
Interruptores e tomadas são objetos que usamos com frequência e consequentemente pode estar transmitindo o vírus caso não seja higienizado da maneira correta. Desta forma, separamos algumas dicas importantes de como proceder a higienização de interruptores e tomadas com segurança. Confira!
??Por serem itens energizados, o correto é desligar a chave geral antes de iniciar a limpeza;
??Utilize um pano úmido e limpo;
??Use água e sabão para a limpeza, isso garantirá a higienização do produto;
??Não use produtos químicos com alvejantes, pois esses produtos removem a proteção ant-UV da peça, podendo acelerar o desgaste da superfície do produto, além de riscar e manchar as placas e interruptores;
??Finalize com álcool 70°, isso irá garantir que todos os germes, bactérias, microrganismos foram eliminados do produto;
??Se necessário use um cotonete para facilitar a finalização da limpeza.
.
